    print('# of distinct results:', len(list(groupby(ls))))
    print('# of each results desc')
    for x, c in sorted([(x, len(list(g))) for x, g in groupby(ls)], key=lambda x:x[1], reverse=True):
        if min(ls) == x:
            print("* {:>2}  {:>3}".format(x, c))
        else:
            print("  {:>2}  {:>3}".format(x, c))
